import { Routes, Route } from 'react-router-dom';
import './App.css';
import Raiting from './Components/Raiting';
import ThankYou from './Components/ThankYou';

function App() {

  return 
  <>
    <Routes>
      <Route exact path="/" element={<Raiting />} />
      <Route path="/ThankYou" element={<ThankYou />} />     
    </Routes>
  </>
  ;
}

export default App;
